import ExpenseItem from "./components/ExpenseItem";

function App() {
  const expense = [
    { date: new Date(2021, 4, 27), title: "car insurance1", amount: "$4000" },
    { date: new Date(2021, 4, 27), title: "car insurance2", amount: "$4000" },
    { date: new Date(2021, 4, 27), title: "car insurance3", amount: "$4000" },
    { date: new Date(2021, 4, 27), title: "car insurance4", amount: "$4000" },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <p>This is So available</p>
      <ExpenseItem />
    </div>
  );
}

export default App;
